import { StyleSheet, Text, View, TextInput, Button } from 'react-native'

const Login = () => {
  return (
    <View>
      <TextInput placeholder='Username'/>
      <TextInput placeholder='Password'/>
      <Button />
    </View>
  )
}

export default Login
